import{_ as a,o as t,c as i,z as e,a as n}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 38.2-6104 License renewals.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/38.2-6104.md","filePath":"vacode/38.2-6104.md"}'),o={name:"vacode/38.2-6104.md"},r=e("h1",{id:"§-38-2-6104-license-renewals",tabindex:"-1"},[n("§ 38.2-6104 License renewals. "),e("a",{class:"header-anchor",href:"#§-38-2-6104-license-renewals","aria-label":'Permalink to "§ 38.2-6104 License renewals."'},"​")],-1),s=e("p",null,[n("A. Each dental plan organization organized under this chapter shall obtain an annual renewal of its license from the Commission by July 1 of each year. The Commission may refuse to renew the license of any dental plan organization or may renew the license, subject to any restrictions considered appropriate by the Commission, if it finds an impairment of the minimum capital and surplus or that the dental plan organization has not satisfied all of the conditions set forth in subsection A of § "),e("a",{href:"http://law.lis.virginia.gov/vacode/38.2-6103/",target:"_blank",rel:"noreferrer"},"38.2-6103"),n(".")],-1),l=e("p",null,"B. The Commission shall not fail or refuse to renew the license of any dental plan organization without first giving the dental plan organization 10 days' notice of its intention not to renew the license and giving it an opportunity to be heard and to introduce evidence on its behalf. The hearing may be informal and the required notice may be waived by the Commission and the dental plan organization.",-1),c=e("p",null,[n("2004, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0668",target:"_blank",rel:"noreferrer"},"668"),n(".")],-1),d=[r,s,l,c];function h(f,p,m,_,u,g){return t(),i("div",null,d)}const y=a(o,[["render",h]]);export{v as __pageData,y as default};
